Support EVE Online and CCP by buying the official CD Soundtrack at http://store.eve-online.com/EVE-Online-Original-Soundtrack-P35.aspx

EVE boasts one the most stunning and beautiful soundtracks ever to grace a computer game. Now you have the chance to get your hands on a compilation of the best music EVE has to offer. &quot;From haunting symphonic sounds and eerie atmosphere to triumphant marches, this is celestial music for the future. Finally, the long anticipated unofficial soundtrack from EVE is available&quot;

